import React from 'react';
import home from './images/home.png';
import {BrowserRouter as Router, Switch,Route} from 'react-router-dom';
import Rightfinder from '../Rightfinder/Rightfinder';
import ex from './images/ex.png';
import minus from './images/minus.png';
import expand from './images/expand.png';
import arrowLeft from './images/arrowLeft.png';
import arrowRight from './images/arrowRight.png';



const Home = () => {
    return(
    <Router>
        <div className='home'>
            {/* finder folder */}
            <div className='finderOpen'> 
                <div className='topFinder'>
                    <div className='control'>
                        <div className='colorButtons'>
                            <div className='redButton'>

                            </div>
                            <div className='yellowButton'>

                            </div>
                            <div className='greenButton'>

                            </div>
                        </div>
                        <div className='backForward'>

                        </div>
                    </div>
                    <div className='icon'>

                    </div>
                </div>
                <div className='bottomFinder'>
                    <div className='leftFinder'>

                    </div>
                    <Switch>
                      <Route path='/' exact component={Rightfinder}> </Route>
                    </Switch>
                </div>
            </div>
            <div className='homeFolder'>
                <img alt='' src={home}></img>
                <div>Home</div>
            </div>
        </div>
    </Router>
    )
}

export default Home;
